import "./App.css";
import LoginForm from "./components/LoginForms";

const express = require("express");
const server = express();
server.use(express.json());
const { router: home, default: HomePage } = require("./Pages/HomePage");
server.use("/home", home);

function App() {
  return (
    <div className="App">
      <LoginForm></LoginForm>
    </div>
  );
}

export default App;
